import { FaUser } from 'react-icons/fa';

const ChatListWrapper = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-flow: row wrap;
  min-height: 300px;
`;

const MessageTile = styled.div`
  width: 100%;
  display: flex;
  flex-flow: row wrap;
  margin-bottom: 10px;
  .avatar {
    width: 50px;
    height: 50px;
    img {
      width: 100%;
      height: 100%;
      object-fit: cover;
      border-radius: 50%;
    }
    .anonimous {
      width: 100%;
      height: 100%;
      font-size: 20px;
      display: flex;
      justify-content: center;
      align-items: center;
      background: #359cdb;
      color: #fff;
      border-radius: 50%;
    }
  }

  .message_info {
    width: calc(100% - 50px);
    padding: 10px;

